import * as React  from 'react';
import styled from '@emotion/styled';
import ResponsiveDrawer from '../layout/ResponsiveDrawer';
import { Home } from '../pages /Home';
import { Hosts } from '../pages /Hosts';
import { BackUp } from '../pages /Backup';
import { Monitor } from '../pages /Monitor';
import { Services } from '../pages /Services';
import { SetupWizard } from '../pages /SetupWizard';
import { UpgradeWizard } from '../pages /UpgradeWizard';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Tryt} from '../pages /Tryt';
import Servicestablejson2 from '../pages /Servicesjson2';
import { NewTables } from '../pages /NewTables';
import { ServicesTable1 } from '../pages /Servicesjson';
import { ServiceData } from '../pages /Servicesjson';
import axios from 'axios';
const StyledApp = styled.div`
  // Your style here
`;

export function App() {
  const [data,setData]=React.useState<ServiceData[]>([]);

  const getProductData = async () => {
      try {
        const data = await axios.get<ServiceData[]>(
          `https://my-json-server.typicode.com/sakthi-vunet/dummyjson/list`
        );

        setData(data.data);
      } catch (e) {
        console.log(e);
      }
    };
  React.useEffect(() => {
      getProductData();
  }, []);

  return (

    <StyledApp>

      <Router>

         {/* <ResponsiveDrawer/> */}
        {/* <Tryt/> */}
        {/* <ServicesTablejson/> */}
        {/* <Servicestablejson2/> */}
        {/* <NewTables/> */}
        {/* <ServicesTable1 data={data}/> */}

        <Routes>

          <Route path='/app/controlcenter' element={<Home/>} />
          <Route path='/app/controlcenter/Hosts' element={<Hosts/>} />
          <Route path='/app/controlcenter/Backup' element={<BackUp/>} />
          <Route path='/app/controlcenter/Monitor' element={<Monitor/>} />
          <Route path='/app/controlcenter/Services' element={<Services/>} />
          <Route path='/app/controlcenter/Setupwizard' element={<SetupWizard/>} />
          <Route path='/app/controlcenter/Upgradewizard' element={<UpgradeWizard/>} />

        </Routes>
      </Router>



    </StyledApp>
  );
}

export default App;
